import logo from './logo.svg';
import './App.css';
import Header from './components/Header';

import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
function App() {
  return (
    <>
      <Router>
        <Header />
        <Routes>
          <Route path='/'></Route>
        </Routes>
      </Router>
    </>
  );
}

export default App;
